export default function Card({vocabList}) {
    return vocabList.map((key, outerIndex) => {
        return (
            <div key={outerIndex} className="card">
                {Object.entries(key).map(([key, value], innerIndex) => {
                    if (key !== 'word') {
                        return (
                            <div className="align"> <span className="red"></span>
                                <span className="yellow"></span>
                                <span className="green"></span>
                                <li key={`${outerIndex}-${innerIndex}`}>{`${key}: ${value}`}</li>

                                <h1>{key==='单词'&&key}</h1> <p>
                                <li key={`${outerIndex}-${innerIndex}-word`}>{key['单词']}</li>
                                </p>
                            </div>
                        );
                    }
                })}
            </div>
        );
    });
}
